import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => (
  <div className="Navbar">
    <h1>Works</h1>
    <nav>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/team">Team</Link></li>
        <li><Link to="https://github.com/">Github</Link></li>
      </ul>
    </nav>
  </div>
);

export default Navbar;
